import React from 'react';
import '../css/components/Toggle.css';

export default () => {
    return (
        <label class="affitto-toggle">
            <span class="affitto-table-align">
                <input id="" type="checkbox"/>    
                <span class="affitto-big-dot"></span>
                <span class="affitto-toggle-line"></span>
            </span>
        </label>
    )
}
